import './Counter.css';
const Counter = () => {
    return(
        <div className="grid-4-cols counter">
            <div className="grid-counter"><h1>15+</h1><p>YEARS OF EXPERIENCE</p></div>
            <div className="grid-counter"><h1>350+</h1><p>SATISFIED CLIENTS</p></div>
            <div className="grid-counter"><h1>20+</h1><p>TEAM MEMBERS</p></div>
            <div className="grid-counter"><h1>45+</h1><p>AWARDS WINNING</p></div>
        </div>
    )
}
export default Counter;
